import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六己日乙丑时断</p><p>六己日生时乙丑，煞星受制不为伤；柱中身旺多荣贵，无助生人昼夜忙。</p><p>己日乙丑时，专财逢鬼，丑上有明乙为鬼，暗癸为财。</p><p>若有倚托通身旺者，贵；通运亦吉。</p><p>若鬼有助，旺不能任者，衣禄平常。</p><p>己丑日乙丑时，时上偏官，居武职都阃，还看地方断之。</p><p>卯月金水运，六七品贵。</p><p>己卯日乙丑时，子申月，行金土运，侯伯。</p><p>巳酉丑戌年月，俱吉。</p><p>己巳日乙丑时，寅卯月，偏官格。</p><p>无酉戌字，文进贵命。</p><p>己未日乙丑时，时日并冲，妻生财可也。</p><p>卯午年月，金神入火乡，西南运，贵。</p><p>辰戌四季全，大贵。</p><p>干透丁辛，纯阴亦贵。</p><p>己酉日乙丑时，卯月，偏官。</p><p>辰月，财煞，贵。</p><p>申酉，伤官伤尽。</p><p>巳午，印绶，俱贵。</p><p>丑戌，亦贵。</p><p>己亥日乙丑时，卯月，大贵。</p><p>申月，水木运，风宪、方面。</p><p>时逢乙丑本身衰，库有财星内伏埋；不遇钥匙难显达，方知出外称心怀。</p><p>己日时临乙丑，库中耗鬼兴灾。</p><p>祖宗产业有盈亏，谋望财去财来。</p><p>戌未刑冲发福，无匙来往搬移，双亲雁序事难依，救未中取贵。</p>",26),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","228卷 九·六己日乙丑时断.html.vue"]]);export{f as default};
